text:
Prezentacja:
czarne, średnio obfita beżowa piana szybko opada do obrączki, nie zdobi szkła;
Aromat:
kwaskowa kawowa paloność, śmietanka, odrobina czekolady;
Odczucie:
ciało niskie, gładkie, wysoko nasycone, puszyste, gryzie w język, finisz czekoladowy;
Smak:
kwaskowa czekolada, odrobina mlecznej słodyczy, wytrawna czekolada i czekoladowa goryczka;
Ogólnie:
liczyłem na więcej ciała, przeszkadza mi też gryzienie bąbelków; poza tym przyzwoite piwo.
